import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

import Cart1 from "./smallComponent/Cart1";
import LoginComponent1 from "./smallComponent/LoginComponent1";
import { red } from "@mui/material/colors";

const Header = () => {
  return (
    <Box className="Header_Component">
      <img
        src="https://i.pinimg.com/originals/82/be/d4/82bed479344270067e3d2171379949b3.png"
        alt=""
        style={{ objectFit: "cover", maxHeight: "10vh", maxWidth: "10vh" }}
      />
      <Cart1
        style={{
          position: "absolute",
          top: "50%",
          transform: "translateY(-50%)",
          backgroundcolor: "red"
        }}
      />
      <LoginComponent1 />
    </Box>
  );
};

export default Header;
